/** @format */

import React from "react";

import { useSelector } from "react-redux";
import { selectIsSignIn } from "../../slices/authenticate.slice";
import { Card, Container, Row, Col, Image, CardColumns } from "react-bootstrap";
import SignIn from "../sign-in/sign-in.component";
import SignUp from "../sign-up/sign-up.component";

const Authenticate = () => {
  const isSignIn = useSelector(selectIsSignIn);
  return (
    <Container
      style={{
        marginTop: "175px",
      }}
    >
      <Row className="justify-content-center">
        <Col sm={10}>
          <CardColumns>
          {isSignIn ? <SignIn /> : <SignUp />}
            <Card>
              <Card.Img
                variant="top"
                src="https://images.unsplash.com/photo-1482049016688-2d3e1b311543?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=3353&q=80"
              />
            </Card>
            <Card>
              <Card.Img
                variant="top"
                src="https://images.unsplash.com/photo-1515003197210-e0cd71810b5f?ixid=MXwxMjA3fDB8MHxzZWFyY2h8MzB8fGZvb2R8ZW58MHx8MHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=60"
              />
            </Card>
            <Card>
              <Card.Img
                variant="top"
                src="https://images.unsplash.com/photo-1512621776951-a57141f2eefd?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=1950&q=80"
              />
            </Card>

          </CardColumns>
        </Col>
      </Row>
    </Container>
  );
};

export default Authenticate;
